import React, { Component } from 'react';

import './App.css';

export class Task extends Component {

  createTasks(item){
    return <li key={item.key} text={item.value}></li>
  }

  render() {
    let taskArr = this.props.tasks;
    let taskList = taskArr.map(this.createTasks); 

    return (
      <div className="App">
        <ul>{taskList.text}</ul>
      </div>
    );
  }
}

export default Task;
